x=new L.kb(R.cg([],[new R.ak(C.f1,"MaterialExpansionDemo","material_expansionpanel_example/lib/material_expansionpanel_example.dart")],[new R.ao("MaterialExpansionPanel","material-expansionpanel","angular_components/lib/material_expansionpanel/material_expansionpanel.dart",'<p>A material-styled expansion-panel.</p>\n<p>One or more panels are grouped together in a expansion-panel-set. When a\npanel is clicked on, the panel contents expand. A panel consists of a name,\na value, optional secondary text, and the expanded panel contents.</p>\n<p>Content element with attribute <code>value</code> will be used as the "value" of the\npanel contents when it is in a collapsed state</p>\n<p>Interactions with a panel are done through the parent expansion-set. The set\ntakes into account the state of the other panels in the set, and issues the\nappropriate actions onto each individual panel.</p>\n<p>TODO(<a href="http://teams/google">google</a>): Keyboard/accessibility inputs</p>\n<p><strong>Example usage:</strong></p>\n<pre><code>&lt;material-expansionpanel (save)="doSave()"&gt;\n  &lt;my-component&gt;&lt;/my-component&gt;\n&lt;/material-expansionpanel&gt;\n\n&lt;material-expansionpanel wide&gt;\n  &lt;div value class="valueClass"&gt;\n    Fancily formatted value of my panel\'s contents\n  &lt;/div&gt;\n  &lt;my-component&gt;&lt;/my-component&gt;\n&lt;/material-expansionpanel&gt;\n</code></pre>\n<p>Material expansion panel also supports deferred content:</p>\n<pre><code>&lt;material-expansionpanel&gt;\n  &lt;div *deferredContent&gt;\n    Deferred panel contents\n  &lt;/div&gt;\n&lt;/material-expansionpanel&gt;\n</code></pre>\n<p><strong>Attributes:</strong></p><ul><li><code>wide</code> -- When specified the width of the panel when expanded, is\nslightly wider then its width when collapsed.</li><li><code>flat</code> -- Indicates that the panel should not "float" or separate from\nother panels when expanded.</li></ul>\n<p><strong>Inputs:</strong></p><ul><li><code>alwaysShowExpandIcon: bool</code> -- If true, the expand icon is always\nvisible regardless of the expanded state or whether custom icon is used.</li><li><code>closeOnSave: bool</code> -- If true, after a successful save, the panel will\nattempt to close.</li><li><code>expanded: bool</code> -- Determines whether the panel is expanded by default.\nOtherwise, the panel is closed by default.</li><li><code>disabled: bool</code> -- If true, the panel will remain in the collapsed state\nwith no way to expand it, or if expanded by default, it will stay in\nexpanded state.</li><li><code>hideExpandedHeader: bool</code> -- If true, the title section of the panel is\nhidden when the panel is expanded.</li><li><code>name: String</code> -- A short name label for the expansion panel.</li><li><code>secondaryText: String</code> -- Some optional secondary summary text that\ndescribes the state of the widget hosted inside the panel.</li><li><code>showSaveCancel: bool</code> -- Determines whether to show the save/cancel\nbuttons by default.</li><li><code>saveText: String</code> -- The text to be shown on the save button (e.g.\n"okay", "apply"). The default text is "save".</li><li><code>cancelText: String</code> -- The text to be shown on the cancel button (e.g.\n"dismiss", "not now"). The default text is "cancel".</li><li><code>saveDisabled: bool</code> -- If true, the save button is disabled.</li><li><code>enterAccepts: bool</code> -- If true, enterAccepts is enabled.</li><li><code>cancelDisplayed: bool</code> -- If true, the cancel button is displayed.</li></ul>\n<p><strong>Events:</strong></p><ul><li><code>expandedChange: bool</code> -- Fired when the panel is opened or closed.</li><li><code>open: AsyncAction&lt;bool&gt;</code> -- Fired when the panel is attempting to open.\nCan be cancelled by <code>event.cancelIf(new Future.value(false));</code></li><li><code>close: AsyncAction&lt;bool&gt;</code> -- Fired when panel is attempting to close.\nCan be cancelled by <code>event.cancelIf(new Future.value(false));</code></li><li><code>save: AsyncAction&lt;bool&gt;</code> -- Fired after user clicks on save button.\nUse <code>event.defer(Future&lt;bool&gt;)</code> to indicate if the save operation was\nsuccessful. If save was unsuccessful, panel will not close.</li><li><code>cancel: AsyncAction&lt;bool&gt;</code> -- Fired after user clicks cancel button.\nUse <code>event.defer(Future&lt;bool&gt;)</code> to indicate if cancel operation should\nitself be cancelled (e.g. Have unsaved changes). If future returns false,\npanel will not be closed.</li></ul>\n'),new R.ao("MaterialExpansionPanelSet","material-expansionpanel-set","angular_components/lib/material_expansionpanel/material_expansionpanel_set.dart","<p>A directive which will turn a set of expansion panels into an accordian\nwidget. Thus only allowing one panel to be open at a time.</p>\n"),new R.ao("MaterialExpansionPanelAutoDismiss","material-expansionpanel[autoDismissable]","angular_components/lib/material_expansionpanel/material_expansionpanel_auto_dismiss.dart","<p>A directive that automatically collapses [MaterialExpansionPanel].</p>\n<p>When a [MaterialExpansionPanel] is expanded, any click outside of it will\nautomatically collapses the panel.</p>\n<p><strong>Example usage:</strong></p>\n<pre><code>&lt;material-expansionpanel autoDismissable&gt;\n&lt;/material-expansionpanel&gt;\n</code></pre>\n")],[],P.d(),[]))
